/*
   WordCard Component
*/
import React from 'react';

class WordCard extends React.Component {
    constructor(props) {
        super(props);
    }
   render() {
    console.log(this.props.data);
     const  data = [
       {
         word:'clause',
         meaning: [
           {
             property: 'n',
             desc: ['条款', '从句']
           }
         ]
       },
       {
         word:'thick',
         meaning: [
           {
             property: 'adv',
             desc: ['密集地'],
           },
           {
             property: 'adj',
             desc: ['厚的','粗的','稠的','浓的'],
           },
         ]
       }
     ];
      return (
        <div>{data[0].word}</div>
      );
   }
}

export default WordCard;
